  input: '"TEXT","F3A","C00384958","Please note:    The contributions from Robert
    Bartels on 3/8/06 & 10/18/06 totaling $2,100 towards the General 2006 Election
    were made from Robert Bartels, Sr. and the contribution of $1,800 towards the
    2006 General Election on 2/8/06 was from Robert Bartels, Jr.    The contributions
    from Michael Leep on 2/14/06 & 10/24/06 totaling $2,100 towards the 2006 General
    Election were made from Michael Leep, Sr. and the contribution of $2,100 on 10/24/06
    towards the 2006 General Election was made by Michael Leep, Jr.    The contribution
    from William Wilkinson on 2/23/06 of $1,929 towards the 2006 General Election
    was from William J. Wilkinson and the 7/18/06 & 10/21/06 contributions totaling
    $1,000 towards the 2006 General Election were made from William W. Wilkinson.    The
    contributions from BACPAC Back Americas Conservatives on 3/24/06 & 5/1/06 totaling
    $2,000 were designated to the 2006 Primary Election according to our records and
    not the 2006 General Election.    In regards to the missing 48-hour notices, the
    48-hour notices for the contribution from Karen Leep on 10/24/06 of $1,500 and
    Michael Leep on 10/24/06 of $2,100 were memo items from a transfer of funds from
    a joint fundraising committee.  The transfer of funds was reported as a 48-hour
    notice on 10/29/06 (FEC-253959).    In regards to the missing 48-hour notice for
    Arthur Decio on 10/30/06 of $2,100 was a memo item from a transfer of funds from
    a joint fundraising committee.  The transfer of funds was reported as a 48-hour
    notice on 11/04/06 (FEC-257556).    In response to the question of the transfer
    from a joint fundraising committee on Line 12 being $293.05 greater than the supporting
    memo-entry, the reason for the difference is a result of the previously determined
    formula of costs, as set forth by the FEC, after which time additional costs and
    contributions were received by the joint fundraising committee which based on
    the costs occurred by Chocola for Congress required increased the percentage of
    the funds to be received by Chocola for Congress."'
